import React, { useEffect, useState } from 'react'
import axios from 'axios'
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    BarElement,
    Title,
    Tooltip,
    Legend
} from "chart.js"
import {Bar} from 'react-chartjs-2'

ChartJS.register(
    CategoryScale,
    LinearScale,
    BarElement,
    Title,
    Tooltip,
    Legend
)
function Weeks() {
  const [chartData, setChartData] = useState({
      datasets: []
  })  
  const [chartOptions, setChartOptions] = useState({})

  useEffect(() => {
    setChartData({
        labels:["v2", "v3", "v4", "v5", "v6"],
        datasets: [
            {
                label: "Whom let the dogs out",
                data: [180, 60, 340, 145, 130],
                borderColor: "rgb(53, 162, 235)",
                backgroundColor: "rgba(53, 162, 235, 0.4)"
            }
        ]
    })
    setChartOptions({
        responsive: true,
        plugins: {
            Legend: {
                position: "top"
            },
            Title: {
                display: true,
                text: ""
            }
        }
    })
  }, [])
   
  return (
    
    <div>
        <Bar options={chartOptions} data={chartData}/>
    </div>
  )
}

export default Weeks
